import React from 'react';
import styled from "styled-components";
import PinterestIcon from "@mui/icons-material/Pinterest";
import Icon from "@mui/material/Icon";


function Header() {
  return (
    <div>
      <Wrapper>
        <LogoWrapper>
          <Icon>
            <PinterestIcon />
          </Icon>
        </LogoWrapper>
      
      <HomeButton>
<a href="/">HomePa</a>
      </HomeButton>
        <Following>
        </Following>
{/*
        <SearchWrapper>
          <SearchBar>

          </SearchBar>
        </SearchWrapper>

<IconWrapper>

</IconWrapper>
*/}
      </Wrapper>
    </div>
  );
}

export default Header
 
const Wrapper=styled.div`
display:flex;
align-items:center;
height:56px;
padding:12px 5px 5px 16px;
background-color:#ffff;
color:black;
`

const LogoWrapper=styled.div`
.MuiSvgIcon-root{
  color:#e60023;
  font-size:32px;
  cursor:pointer;

}`
